import React, { useState, useEffect } from "react";
import { getHistory } from "../services/api";
import "../App.css";

const SearchHistory = () => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    fetchHistory();
  }, []);

  const fetchHistory = async () => {
    const data = await getHistory();
    setHistory(data);
  };

  return (
    <div className="bg-white p-6 rounded-lg shadow-lg w-3/4 max-w-4xl overflow-auto max-h-96">
      <h2 className="text-2xl font-bold mb-4 text-gray-700">Historial de BÃºsquedas</h2>
      <table className="w-full bg-gray-100 rounded-lg">
        <thead>
          <tr className="bg-gray-300 text-gray-700">
            <th className="py-2 px-4">Fecha</th>
            <th className="py-2 px-4">Cat Fact</th>
            <th className="py-2 px-4">Query</th>
            <th className="py-2 px-4">GIF URL</th>
          </tr>
        </thead>
        <tbody>
          {history.length === 0 ? (
            <tr>
              <td colSpan="4" className="text-center py-4 text-gray-500">
                No hay historial disponible
              </td>
            </tr>
          ) : (
            history.map((item) => (
              <tr key={item.id} className="border-b border-gray-200 hover:bg-gray-50">
                <td className="py-2 px-4 text-gray-600">{new Date(item.searchDate).toLocaleString()}</td>
                <td className="py-2 px-4 text-gray-600">{item.catFact}</td>
                <td className="py-2 px-4 text-gray-600">{item.query}</td>
                <td className="py-2 px-4">
                  {item.gifUrl ? (
                    <a href={item.gifUrl} target="_blank" rel="noopener noreferrer" className="text-blue-500 underline">
                      Ver GIF
                    </a>
                  ) : (
                    "No disponible"
                  )}
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default SearchHistory;
